-- 3. ENHANCED SAFE IMPORT (WITH OVERWRITE LOGIC)
local function SafeImport(id, addonLink, stringKey, importFunc)
    if not MY_STRINGS[stringKey] or MY_STRINGS[stringKey] == "" or MY_STRINGS[stringKey] == "PASTE_STRING_HERE" then
        print("|cffff0000[GladargUI Error]:|r No string found for " .. stringKey)
        return false
    end
    if not addonLink then
        print("|cffff0000[GladargUI Error]:|r " .. stringKey .. " Addon not found.")
        return false
    end

    -- PROTECTED CALL
    local success, err = pcall(importFunc, MY_STRINGS[stringKey])
    
    if success then 
        local t = date("%m/%d %H:%M")
        GladargUIDB.lastImportTimes[id] = t
        print("|cff00ff00[GladargUI]:|r " .. stringKey .. " imported and overwritten successfully.")
        return true
    else
        print("|cffff0000[GladargUI Critical]:|r " .. stringKey .. " failed: " .. tostring(err))
        return false
    end
end

