-- QUI (Midnight)
CreateImportRow("QUI", "QUI", -80, "QUI", function(s) 
    -- QUI's Midnight API is designed to overwrite the active profile by default
    QUI.ImportProfile(s, true) -- The 'true' flag forces overwrite in most modern frameworks
end)

