    if Plater.DecompressData then
        local profile = Plater.DecompressData(s)
        if profile then
            Plater.ImportProfile(s, true, true) -- Force Overwrite + Skip Confirmation
        end
    else
        Plater.ImportProfile(s)
    end
end)

