CreateImportRow("DETAILS", "Details", -160, "DETAILS", function(s) 
    -- Details utilizes a specific Overwrite flag in its ImportProfile method
    Details:ImportProfile(s, nil, true) -- 'true' at the end forces overwrite
end)

